import data from './data';

import Card from './Card.js';
let Cake = (props)=>{

    return(
        <div>
    {data.map((each,index)=>{   
        return (
             <span>
              <div class="card-deck">

                 <Card data={each} index ={index}></Card>
                 </div>
                 </span>

         )

     })}
     </div>
    )

}
export default Cake
